import "./App.css";
import logo from "./logo.png"; // with import

function App() {
  return (
    <>
      <header className="header">
        <img src={logo} alt="sfs baseball"></img>
        <nav className="navbar-wrapper">
          <div className="navbar-item">Varsity</div>
          <div className="navbar-item">J.V.</div>
          <div className="navbar-item">Flordia</div>
          <div className="navbar-item">Records</div>
          <div className="navbar-item">History</div>
          <div className="navbar-item">Info</div>
        </nav>
      </header>
    </>
  );
}

export default App;
